import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App.js"
import { BrowserRouter } from "react-router-dom";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <div className='mainWrapper'>
      </div>
        <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);
